import React from 'react';
import MainMenu from './components/Menu.js'
import { Player, ControlBar  } from 'video-react';



function App() {
  return (
          <div className = 'App'>
            <MainMenu></MainMenu>
            <Player
              playsInline
              src="https://media.w3.org/2010/05/sintel/trailer_hd.mp4"
              width={480}
              height={272}
              fluid={false}
              autoPlay={true}><ControlBar disableCompletely={true}  /></Player>
          </div>
        );
}

export default App;
